import React from 'react';

const Footer = () => {
    return (
        <footer className="footer text-white py-6">
            <div className="max-w-screen-xl mx-auto px-6 text-center">
                <p>&copy; {new Date().getFullYear()} Blog Market. Все права защищены.</p>
                <div className="mt-4">
                    <a href="/about" className="text-gray-400 hover:text-white mx-4">О нас</a>
                    <a href="/contact" className="text-gray-400 hover:text-white mx-4">Контакты</a>
                    <a href="/privacy" className="text-gray-400 hover:text-white mx-4">Политика конфиденциальности</a>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
